import React from 'react'
import styled from "styled-components";
function Header() {
    return (
        <Container>
               <img  src="/images/logo.svg" alt=""/>
               <Elements>
               <ul>
                  <li>Model S</li>
                  <li>Model 3</li>
                  <li>Model X</li>
                  <li>Model Y</li>
                  <li>Solor roof</li>
                  <li>solor Panel</li>
              </ul>
               </Elements>
        </Container>
    )
}

export default Header

const Container = styled.div `
    max-width:60px;
    position:fixed;
    padding:20px ;
    display-flex;

`
const Elements = styled.ul `
 
display:flex;



`
